    public static int partition(char[] arr, int lo, int hi){
        char pivot = arr[hi];
        int i = lo - 1;

        for(int j = lo; j < hi  ; j++ ){
            // check count
            if(arr[j] < pivot ){
                i++;
                char temp = arr[i];
                arr[i] = arr[j];
                arr[j] = temp;
            }
//            if(hm.get(arr[j]).count > hm.get(pivot).count){
//                i++;
//                char temp = arr[i];
//                arr[i] = arr[j];
//                arr[j] = temp;
//            }
//            else if(hm.get(arr[j]).count == hm.get(pivot).count){
//                if(arr[j] < pivot ){
//                    i++;
//                    char temp = arr[i];
//                    arr[i] = arr[j];
//                    arr[j] = temp;
//                }
//                else if(hm.get(arr[j]).index < hm.get(pivot).index){
//                    i++;
//                    char temp = arr[i];
//                    arr[i] = arr[j];
//                    arr[j] = temp;
//                }
//
//            }
        }

        i++;
        char temp = arr[i];
        arr[i] = arr[hi ];
        arr[hi] = temp;


        return i;
    }

    public static void quickSort(char[] a, int lo, int hi){
        if(lo < hi){
            int pivot = partition(a,lo,hi);
            quickSort(a,lo,pivot - 1);
            quickSort(a,pivot + 1, hi);
        }
    }

